“If I’m walking down in an outfit that feels so good, that’s all that matters.” 

@tanfrance teaches how to choose clothes that make YOU happy because feeling your best is what really matters. 

What makes you feel proud? Share it with #PrideIs.

“I do literally lean in when I’m talking to someone…to let them know I not only hear you, I see you, and I want to learn more about you.” 

@robinrobertsgma takes pride in listening to and learning from others. 

Share what #PrideIs to you.
